import React from 'react';
import { Button, IconButton, Tooltip, Typography } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import PeopleOutlineTwoToneIcon from '@mui/icons-material/PersonAddAlt1Rounded';

const AddNewStaffButton = () => {
  const navigate = useNavigate();

  return (
    <div className='addButton'>
      <Button onClick={() => navigate('/staffs/create')}
        variant='contained'
        startIcon={<PeopleOutlineTwoToneIcon style={{
          fontSize: '30px',
          padding: 2
        }}/>}>
        <Typography sx={{
          textTransform: 'none'
        }} >Προσθήκη Προσωπικού</Typography>
      </Button>
      {/* <IconButton onClick={() => navigate('/staffs/create')}>
          <PeopleOutlineTwoToneIcon
            style={{
              textTransform: 'none',
              fontSize: '60px',
              color: "#03074f"
            }}
          />
        </IconButton> */}
    </div>
  )
}

export default AddNewStaffButton;
